import React from 'react'
import { Link } from 'react-router-dom'
import PropTypes from 'prop-types'

const AllClasses = ({
  profile: {
    events: { _id, teachersName, eventName, eventType, location, eventDate, eventTime, description}
  }
}) => {
  return (
    <div className='class-card'>
      <h2 className='class-title'>Class: {eventName}</h2>
      <p>
        <strong>Taught by:</strong> {teachersName}
      </p>
      <p>
        <strong>Category:</strong> {eventType}
      </p>
      <p>
        <strong>Location:</strong> {location}
      </p>
    </div>
  )
}
AllClasses.propTypes = {
  profile: PropTypes.object.isRequired
}
export default AllClasses
